FOR EACH ROW
  BEGIN
    INSERT INTO solr_queue_delete (sku, triggered_at) VALUES (OLD.sku, NOW());

    DELETE FROM solr_queue_populate_sku WHERE sku = OLD.sku;
    DELETE FROM solr_queue_inventory WHERE sku = OLD.sku;
